#include <cmath>

#include "GaussNewton3.h"
#include "GaussNewton3_initialize.h"

using namespace std;

template<typename T>
vector<T> slice(vector<T> const& v, int m, int n)
{
    auto first = v.cbegin() + m;
    auto last = v.cbegin() + n + 1;

    vector<T> vec(first, last);
    return vec;
}

float fit(vector<double> x, vector<double> y)
{
    double beta0[3] = { 30, 10, 2 };
    double lb[3] = { 0, 0, 0 };
    double ub[3] = { 60, 60, 30 };
    double coeff[3];
    double iter;
    vector<double> xinterest = slice(x, 0, 29);
    vector<double> dxinterest = slice(y, 0, 29);
    int i = 30;
    GaussNewton3(xinterest, dxinterest, beta0, lb, ub, coeff, &iter);
    double coeffprev[3]{};
    coeffprev[0] = coeff[0];
    coeffprev[1] = coeff[1];
    coeffprev[2] = coeff[2];
    bool flag = false;
    bool returnflag = false;
    float thresh = 0.5;
    while (i < x.size()) {
        xinterest.push_back(x[i]);
        dxinterest.push_back(y[i]);
        GaussNewton3(xinterest, dxinterest, beta0, lb, ub, coeff, &iter);
        if (iter < 24) 
        {
            if (abs(coeffprev[0] - coeff[0]) < thresh && abs(coeffprev[1] - coeff[1]) < thresh && abs(coeffprev[2] - coeff[2]) < thresh)
            {
                if (coeff[0] < ub[0] && coeff[1] < ub[1] && coeff[2] < ub[2])
                {
                    flag = true;
                }
            }
            coeffprev[0] = coeff[0];
            coeffprev[1] = coeff[1];
            coeffprev[2] = coeff[2];
        }
        else 
        {
            // cout << "Did not converge." << endl;
        }
        if (flag == true) 
        {
            if (returnflag == true)
            {
                return coeff[1] + 2.45 * coeff[2];
            }
            cout << "Cutoff on first Gaussian triggered at " << i << endl;
            cout << "Coefficients are " << coeff[0] << " " << coeff[1] << " " << coeff[2] << endl;
            cout << "Previous coefficients are " << coeffprev[0] << " " << coeffprev[1] << " " << coeffprev[2] << endl;
            while (x[i] < coeff[1] + 2 * coeff[2])
            {
                i++;
                if (i > x.size())
                {
                    break;
                }
            }
            xinterest.resize(30);
            dxinterest.resize(30);
            if (i + 29 < x.size())
            {
                xinterest = slice(x, i, i + 29);
                dxinterest = slice(y, i, i + 29);
            }
            else { return 0; }
            i = i + 29;
            beta0[1] = 17;
            // cout << "New start index: " << i << endl;
            flag = false;
            returnflag = true;
        }
        i++;
    }
    return 0;
}

